import React from "react"
import { Player } from 'video-react';


function Vplayer () {
  return (
    <>
        <Player
          playsInline
          fluid="false"
          width="50%"
          poster="/assets/poster.png"
          src="videos/01.mp4"
        />
    </>
  )
}

export default Vplayer
